import React from "react";

import {
  Container,
  Typography,
  TextField,
  Button,
  Link,
  InputAdornment,
} from "@mui/material";
import VisibilityIcon from "@mui/icons-material/Visibility";
import VisibilityOffIcon from "@mui/icons-material/VisibilityOff";

function AddEmployee() {
  return (
    <Container maxWidth="xs">
      <Typography
        variant="h3"
        gutterBottom
        style={{ marginTop: "32px", textAlign: "center" }}
        color="primary"
      >
        Add new Employee
      </Typography>
      <form noValidate>
        <TextField
          variant="outlined"
          margin="normal"
          label="First Name"
          fullWidth
          required
          style={{ marginBottom: "12px" }}
        />
        <TextField
          variant="outlined"
          margin="normal"
          label="Last Name"
          fullWidth
          required
          style={{ marginBottom: "12px" }}
        />
        <TextField
          variant="outlined"
          margin="normal"
          label="First Name"
          fullWidth
          required
          style={{ marginBottom: "12px" }}
        />
      </form>
    </Container>
  );
}

export default AddEmployee;
